import React, {Component} from 'react';
import {Drawer, List, Typography} from "antd";
import rankStyle from "./index.module.css";
import {ArrowUpOutlined} from "@ant-design/icons";

const data = [
    'Racing car sprays burning fuel into crowd.',
    'Japanese princess to wed commoner.',
    'Australian walks 100km after outback crash.',
    'Man charged over missing wedding girl.',
    'Los Angeles battles huge wildfires.',
];

class Rank extends Component {

    toggleRank=()=>{
        this.props.toggleRank();
    }

    render() {
        return (
            <Drawer bodyStyle={{paddingTop:'40px',overflow:'hidden',background:'rgba(255,77,79,0.1)',fontSize:"14px"}} visible={this.props.visible} width={530} closable getContainer={false}
                    className={rankStyle.box} onClose={this.toggleRank}>
                <List className={rankStyle.list}
                    header={<div>热门话题TOP10</div>}
                    bordered
                    dataSource={data}
                    renderItem={item => (
                        <List.Item>
                            <ArrowUpOutlined/>{item}
                        </List.Item>
                    )}
                />
            </Drawer>
        );
    }
}

export default Rank;
